package Java;

public class type_Casting {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		double a=5.555;
		int b=(int) a;
		System.out.println(b);
		float c=(float) a;
		System.out.println(c);
		long d=(long) a;
		System.out.println(d);
		

	}

}
